let filename_accepted = $input.first().json.accepted_files; 

let binary = $("SPLIT_CORRECT_INCORRECT_FILES").first().binary;

// Crear un nuevo objeto binary que solo contenga los archivos aceptados
let newBinary = [];
// Iterar sobre cada clave en el objeto binary
if (binary) {
  Object.keys(binary).forEach((key) => {
    let file = binary[key];
    // Verificar si algún elemento de filename_accepted (sin extensión) está contenido en el fileName del binario
    let valido = filename_accepted.some((name) =>
      file.fileName.includes(name.replace(".pdf", "")),
    );

    if (valido) {
      newBinary.push(file);
    }
  });
}
const items = [];
